import { FC } from "react";

type TodoProps = {
  name: string;
  done: boolean;
};

const Todo: FC<TodoProps> = ({ name, done }) => {
  return (
    <div>
      <label>
        <input type="checkbox" defaultChecked={done} />
        {name}
      </label>
    </div>
  );
};

export default Todo;
